import './Upload-Download-page.css';


export function uploadDownload() {

    const UploadButton = () => {};
    const DownloadButton = () => {};

	return (
		<div class="center">
			<h1>Firefly</h1>
            <button onClick={UploadButton}>Upload a file</button>
            <button onClick={DownloadButton}>Download a file</button>
            <br></br>
            <label htmlFor="pin">Enter 6-digit Code:</label>
            <input
                type="text"
                id="pin"
            />
		</div>
	);





}
